import React, { useState, useEffect } from 'react';
import { collection, getDocs, query, orderBy } from 'firebase/firestore';
import { db } from '../services/firebase';
import ProductCard from '../components/ProductCard';
import { useAuth } from '../hooks/useAuth';
import { Plus } from 'lucide-react';
import { Link } from 'react-router-dom';
import toast from 'react-hot-toast';

const HomePage = () => {
  const { user } = useAuth();
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [favorites, setFavorites] = useState(new Set());

  useEffect(() => {
    loadProducts();
    if (user) {
      loadFavorites();
    }
  }, [user]);

  const loadProducts = async () => {
    try {
      const q = query(collection(db, 'articulos'), orderBy('createdAt', 'desc'));
      const querySnapshot = await getDocs(q);
      const productsData = querySnapshot.docs.map(doc => ({
        id: doc.id,
        ...doc.data()
      }));
      setProducts(productsData);
    } catch (error) {
      console.error('Error loading products:', error);
      toast.error('Error al cargar productos');
    } finally {
      setLoading(false);
    }
  };

  const loadFavorites = async () => {
    if (!user) return;

    try {
      const q = query(collection(db, 'favorites'));
      const querySnapshot = await getDocs(q);
      const userFavorites = new Set();

      querySnapshot.docs.forEach(doc => {
        const data = doc.data();
        if (data.userId === user.uid) {
          userFavorites.add(data.articleId);
        }
      });

      setFavorites(userFavorites);
    } catch (error) {
      console.error('Error loading favorites:', error);
    }
  };

  const handleFavorite = async (productId) => {
    // Implementar l贸gica de favoritos
    toast.success('Funcionalidad de favoritos pr贸ximamente');
  };

  const handleEdit = (product) => {
    // Navegar a edici贸n
    toast.success('Funcionalidad de edici贸n pr贸ximamente');
  };

  const handleDelete = (productId) => {
    // Implementar eliminaci贸n
    toast.success('Funcionalidad de eliminaci贸n pr贸ximamente');
  };

  if (loading) {
    return (
      <div className="min-h-screen bg-gray-50 flex items-center justify-center">
        <div className="animate-spin rounded-full h-32 w-32 border-b-2 border-[#205781]"></div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Header Section */}
      {user && (
        <div className="bg-white shadow-sm">
          <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-6">
            <div className="flex items-center justify-between">
              <div>
                <h1 className="text-2xl font-bold text-gray-800">
                  Descubre productos 煤nicos
                </h1>
                <p className="text-gray-600 mt-1">
                  Encuentra lo que buscas en nuestra comunidad
                </p>
              </div>
              <Link
                to="/create"
                className="bg-[#205781] text-white px-6 py-3 rounded-lg hover:bg-opacity-90 transition-colors flex items-center space-x-2"
              >
                <Plus className="w-5 h-5" />
                <span>Crear Publicaci贸n</span>
              </Link>
            </div>
          </div>
        </div>
      )}

      {/* Products Grid */}
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        {products.length === 0 ? (
          <div className="text-center py-16">
            <div className="text-6xl mb-4"></div>
            <h3 className="text-xl font-semibold text-gray-800 mb-2">
              No hay productos disponibles
            </h3>
            <p className="text-gray-600">
              S茅 el primero en publicar algo incre铆ble
            </p>
          </div>
        ) : (
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4 gap-6">
            {products.map((product) => (
              <ProductCard
                key={product.id}
                product={product}
                onFavorite={handleFavorite}
                onEdit={handleEdit}
                onDelete={handleDelete}
                isFavorite={favorites.has(product.uuid)}
              />
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default HomePage;
